import React from 'react';

const GoogleMap = () => {
  return (
    <div className="map-container">
      <iframe
        src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3944.123456!2d78.3140369!3d9.3710121!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3b010c046e228d07:0x9c2a31c991948e34!2sUdaikulam,+Tamil+Nadu+623706!3b1!8m2!3d9.4394505!4d78.5582336!16s%2Fg%2F11bw89p214"
        width="100%"
        height="450"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
        referrerPolicy="no-referrer-when-downgrade"
      ></iframe>
    </div>
  );
};

export default GoogleMap;
